import React from 'react'
import { View, Text, StyleSheet } from 'react-native'

import ImageDetail from '../components/ImageDetail'

const ImageScreen = () => {
    return (
        <View>
            <Text>
                ImageScreen
            </Text>
            <View style={style.imagesContainer}>
                <ImageDetail
                    title="From props"
                    url="https://images.unsplash.com/photo-1497034825429-c343d7c6a68f?ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=1234&q=80"
                />
                <ImageDetail
                    title="From props"
                    url="https://images.unsplash.com/photo-1497034825429-c343d7c6a68f?ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=1234&q=80"
                />
            </View>
        </View>

    );
}

const style = StyleSheet.create({
    imagesContainer: {
        paddingVertical: 50
    }

})

export default ImageScreen;
